import gql from "graphql-tag";

const GET_BOOKS = gql`{
    getNotes {
        title
        content
        author
        place
    }
}`;

const CREATE_NOTE = gql`
  mutation createNote(
      $title: String!,
      $content: String!,
      $author: String!,
      $place: String!,

      ) {
    createNote(
        title: $title,
        content: $content,
        author: $author,
        place: $place,
    )
  }
`;

export default {
    GET_BOOKS,
    CREATE_NOTE,
}
